in the wake of the #metoo movement, two companies, schweppes and ogilvy, created a video campaign addressing sexual harassment with the "dress for respect," a smart dress designed to sense touch on the wearer's body. some have been critical of the campaign, suggesting that women should know what they're getting into and avoid the club altogether. but we ask: why is the burden of change on the women? shouldn't men be expected to show respect for women no matter where they are?

