text:
@finding_our_voices began in 2009, hoping to provide a platform for survivors of sexual assault to share their healing journeys through artwork. it began as an annual art show, still held every april at @cottonwoodcenterforthearts (where fov recently moved into its first official office space). over the years aubry and a network of volunteers added art therapy workshops, now offered monthly at cottonwood; occasional weekend retreats; and a currently defunct peer support group they hope to revive.

learn more about fov online at csindy.com and indygive.com! . . . . 
#coloradosprings #cosprings #cospringslife #indgive #liveheregivehere #sexualassault #metoo #csindy #nonprofit

