text:
when this #sexualabusesurvivorstory broke out about 3 weeks ago in commemoration of the #16dayscampaignagainstgenderbasedvoilence more women and ladies spoke out about their  stories. 
to end the year we will begin a #sexualabusesurvivorstories #series to shed more light on this scourge. some people never survive the psychological impact of sexual abuse.  in the new year we will take our campaign to schools and engage the media more to  fight every form of violence against women and girls! 
